script: |
  super -f text -I q1950.spq | sort > q1950.out

inputs:
  - name: q1950.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + col0 + + - ( CAST ( NULL AS INTEGER ) ) NOT BETWEEN - 32 AND - 56 * col0 * - ( + - col0 );
  - name: tab2

outputs:
  - name: q1950.out
    data: |
